import React, { useEffect, useState } from "react";
import { Button, Box, Typography, Grid, Card, CardContent, IconButton } from "@mui/material";
import { Delete } from "@mui/icons-material";
import api from "../../services/api";

const Dashboard: React.FC = () => {
  interface Note {
    _id: string;
    title: string;
    content: string;
  }

  const [notes, setNotes] = useState<Note[]>([]);

  const fetchNotes = async () => {
    try {
      const response = await api.get("/notes");
      setNotes(response.data);
    } catch (error) {
      console.error("Error fetching notes:", error);
    }
  };

  const handleDelete = async (id: string) => {
    try {
      await api.delete(`/notes/${id}`);
      setNotes(notes.filter((note) => note._id !== id));
    } catch (error) {
      console.error("Error deleting note:", error);
    }
  };

  useEffect(() => {
    fetchNotes();
  }, []);

  return (
    <Box
      sx={{
        p: 2,
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        height: "100vh",
        backgroundColor: "#f9f9f9",
      }}
    >
      {/* Top Bar */}
      <Box
        sx={{
          width: "100%",
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          mb: 2,
        }}
      >
        <Typography variant="h6" sx={{ fontWeight: "bold" }}>
          Dashboard
        </Typography>
        <Button variant="text" color="primary" href="/logout">
          Sign Out
        </Button>
      </Box>

      {/* Welcome Card */}
      <Card
        sx={{
          width: "100%",
          maxWidth: 500,
          mb: 3,
          p: 2,
          textAlign: "center",
          boxShadow: 2,
          borderRadius: "10px",
        }}
      >
        <CardContent>
          <Typography variant="h6" fontWeight="bold">
            Welcome, Jonas Kahnwald!
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Email: xxxxxx@xxxx.com
          </Typography>
        </CardContent>
      </Card>

      {/* Create Note Button */}
      <Button
        variant="contained"
        href="/create-note"
        sx={{
          width: "100%",
          maxWidth: 300,
          mb: 3,
          py: 1.5,
          fontWeight: "bold",
          backgroundColor: "#367AFF",
          borderRadius: "10px",
        }}
      >
        <Typography
          variant="button"
          sx={{
            color: "#FFF",
            fontFamily: "Inter",
            fontSize: "16px",
            fontStyle: "normal",
            fontWeight: 600,
            lineHeight: "120%", // 19.2px
            letterSpacing: "-0.16px",
          }}
        >
          Create Note
        </Typography>
      </Button>

      {/* Notes List */}
      <Box
        sx={{
          width: "100%",
          maxWidth: 500,
          flexGrow: 1,
          overflowY: "auto",
        }}
      >
        <Typography variant="h6" gutterBottom>
          Notes
        </Typography>
        <Grid container spacing={2}>
          {notes.map((note, index) => (
            <Grid item xs={12} key={note._id}>
              <Card
                sx={{
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                  boxShadow: 1,
                  borderRadius: "8px",
                  p: 1.5,
                }}
              >
                <Box>
                  <Typography variant="subtitle1" fontWeight="bold">
                    Note {index + 1}: {note.title}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    {note.content}
                  </Typography>
                </Box>
                <IconButton
                  aria-label="delete"
                  color="error"
                  onClick={() => handleDelete(note._id)}
                >
                  <Delete />
                </IconButton>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
};

export default Dashboard;
